import React from "react";
import { Carousel } from "antd";
import "./CarouselPicture.sass";

const CarouselPicture = (data) => {
  console.log(data);
  const onChange = (e) => {
    console.log(e);
  };
  return (
    <Carousel afterChange={onChange} className="carousel">
      <div>
        <div style="background-image: url(https://i.imgur.com/4ndjo3V.png); height: 200px; width: 200px; background-size: cover;"></div>
      </div>
      <div>
        <img
          src={
            "https://images.pexels.com/photos/17666499/pexels-photo-17666499.jpeg?auto=compress&cs=tinysrgb&fit=crop&h=627&w=1200"
          }
          alt=""
        />
      </div>
      <div>
        <img
          src={
            "https://images.pexels.com/photos/17666499/pexels-photo-17666499.jpeg?auto=compress&cs=tinysrgb&fit=crop&h=627&w=1200"
          }
          alt=""
        />
      </div>
      <div>
        <img
          src={
            "https://images.pexels.com/photos/17666499/pexels-photo-17666499.jpeg?auto=compress&cs=tinysrgb&fit=crop&h=627&w=1200"
          }
          alt=""
        />
      </div>
    </Carousel>
  );
};

export default CarouselPicture;
